import React from "react";

const Info = () => {
  return (
    <div
      className="note"
      style={{
        border: "2px solid #eee",
        width: "200px",
        fontFamily: "sans-serif",
        padding: "5px",
      }}
    >
      <h1>Title</h1>
      <p>Info</p>
    </div>
  );
};

export default Info;
